import ReactDom from 'react-dom';
import "./assets/style.css";

class QuizApp extends Component {
    render() {
        return (
            <div className="container">
                <div className="title">QuizApp</div>
            </div>
        );
    }
}

ReactDom.render(<QuizApp/>, document.getElementById("root"));
